const Navbar = () => {
    return(
      <div>
        <nav class="navbar bg-light">
          <div class="container-fluid">
            <a class="navbar-brand" href="gosomewhere">
              <img src="maqure\maqure-high-resolution-color-logo.svg" alt="" width="30px" height="24px" class="d-inline-block align-text-top" />
            </a>
          </div>
        </nav>
      </div>
    )
}
export default Navbar;
